Documentação básica para matrícula
Todos os candidatos deverão apresentar original e cópia dos seguintes documentos:
a) original e cópia do documento oficial de identidade com foto; 
b) original e cópia do documento de identidade e do Cadastro de Pessoas Físicas (CPF);
c) original e cópia de comprovante de residência; 
d) 6 (seis) fotografias recentes, coloridas, iguais, modelo 3x4; 
e) comprovação de cumprimento das obrigações militares, para indivíduos do sexo masculino, maiores de 18 (dezoito) anos; 
f) Título de Eleitor e comprovantes de votação (ou Certidão de Quitação Eleitoral), para maiores de 18 anos;
g) original e cópia da certidão de nascimento; e, 
h) declaração original de conclusão da 3ª Série do Ensino Médio, emitida pelo estabelecimento de ensino correspondente, informando as providências tomadas para a liberação do Histórico Escolar.

